import React, { Component } from 'react';
import './style.css';



class Packages extends Component {

constructor(props) {
    super(props);
    this.state = {
        items: [],
        isLoaded: false,
    }
}

componentDidMount() {
    fetch('http://localhost:3000/packages')
        .then(res => res.json())
        .then(json => {
            this.setState({
                isLoaded:true,
                items: json,
            })
        });
}

render() {
    return (
        <div className="Packages">

        </div>
    );
}


};

export default Packages;
